import React from 'react'
import SinglePost from './SinglePost'
import "./BottomProfile.css";

const BottomProfile = ({bottomProfile}) => {
    return (
        <>
        <div className="bottomProfile">
        {!bottombottomProfile.map((p)=>(
                <SinglePost post={p} />
            ))}
        </div>
        </>
    )
}

export default BottomProfile;
